{"changed":true,"filter":false,"title":"time_date.rb","tooltip":"/Enumerables/Coding Interviews - Flexport/time_date.rb","value":"\n\n=begin\nWe are writing a tool to help users manage their calendars. Given an unordered list of times of day when someone is busy, write a function that tells us whether they're available during a specified period of time.\n\nEach time is expressed as an integer using 24-hour notation, such as 1200 (12:00), 1530 (15:30), or 800 (8:00).\n\nSample input:\n\nmeetings = [\n  [1230, 1300],\n  [845, 900],\n  [1300, 1500]\n]\n\nExpected output:\n\nisAvailable(meetings,  830,  845)  => true\nisAvailable(meetings, 1330, 1400)  => false\nisAvailable(meetings,  830,  930)  => false\nisAvailable(meetings,  855,  930)  => false\nisAvailable(meetings, 1500, 1600)  => true\nisAvailable(meetings,  845,  900)  => false\nisAvailable(meetings, 1229, 1231)  => false\n\n=end\n\nmeetings = [\n    [1230, 1300],\n    [845, 900],\n    [1300, 1500], \n]\n\ndef isAvailable(meetings, start_time, end_time)\n  sorted_meetings = {}\n  meetings.each do |meeting|\n    start_time = meeting[0]\n    end_time = meeting[1]\n    sorted_meetings[start_time] = end_time\n  end\n  sorted1_start = sorted_meetings.keys.sort!\n  sorted1_end = sorted_meetings.values.sort!\n  size = sorted1_start.length + 1\n  sorted_meetings.each do |meeting_start, meeting_end|\n      # if before or after return true\n     which_bucket(meeting_start, meeting_end, start_time, end_time, size)\n  end\n  \n  \n  \nend\n\ndef which_bucket(meeting_start, meeting_end, start_time, end_time, size)\n    bucket = []\n    size.times do |i|\n       i += 1 \n       bucket.push(i)\n    end\n    return bucket\nend\n\nputs which_bucket(830, 845, 845, 900, 4)\n\n\nputs isAvailable(meetings,  830,  845)  #=> true\nputs isAvailable(meetings, 1330, 1400)  #=> false\nputs isAvailable(meetings,  830,  930)  #=> false\nputs isAvailable(meetings,  855,  930)  #=> false\nputs isAvailable(meetings, 1500, 1600)  #=> true\nputs isAvailable(meetings,  845,  900)  #=> false\nputs isAvailable(meetings, 1229, 1231)  #=> false","undoManager":{"mark":-294,"position":100,"stack":[[{"start":{"row":44,"column":13},"end":{"row":44,"column":14},"action":"remove","lines":["k"],"id":293},{"start":{"row":44,"column":12},"end":{"row":44,"column":13},"action":"remove","lines":["c"]},{"start":{"row":44,"column":11},"end":{"row":44,"column":12},"action":"remove","lines":["u"]},{"start":{"row":44,"column":10},"end":{"row":44,"column":11},"action":"remove","lines":["b"]}],[{"start":{"row":44,"column":10},"end":{"row":44,"column":11},"action":"insert","lines":[")"],"id":294},{"start":{"row":44,"column":11},"end":{"row":44,"column":12},"action":"insert","lines":["b"]}],[{"start":{"row":44,"column":11},"end":{"row":44,"column":12},"action":"remove","lines":["b"],"id":295},{"start":{"row":44,"column":10},"end":{"row":44,"column":11},"action":"remove","lines":[")"]}],[{"start":{"row":44,"column":10},"end":{"row":44,"column":11},"action":"insert","lines":["_"],"id":296},{"start":{"row":44,"column":11},"end":{"row":44,"column":12},"action":"insert","lines":["b"]},{"start":{"row":44,"column":12},"end":{"row":44,"column":13},"action":"insert","lines":["u"]},{"start":{"row":44,"column":13},"end":{"row":44,"column":14},"action":"insert","lines":["c"]},{"start":{"row":44,"column":14},"end":{"row":44,"column":15},"action":"insert","lines":["k"]},{"start":{"row":44,"column":15},"end":{"row":44,"column":16},"action":"insert","lines":["e"]},{"start":{"row":44,"column":16},"end":{"row":44,"column":17},"action":"insert","lines":["t"]}],[{"start":{"row":44,"column":17},"end":{"row":44,"column":19},"action":"insert","lines":["()"],"id":297}],[{"start":{"row":44,"column":18},"end":{"row":44,"column":19},"action":"insert","lines":["m"],"id":298},{"start":{"row":44,"column":19},"end":{"row":44,"column":20},"action":"insert","lines":["e"]},{"start":{"row":44,"column":20},"end":{"row":44,"column":21},"action":"insert","lines":["e"]